import React from 'react'
import "./styles.css";
import Button from '@mui/material/Button';
import {useState} from "react"

const Navbar = () => {
  const [navText,setNavText] = useState("")  
  const [navContent,setNavContent] = useState([])
    return (
        <div className="navbar">
            <div className="navbar-content">
                <div className="navbar-log">
                    {/* <img scr={} alt="logo" /> */}
                    <p>Estatery</p>
                </div>
                <p className="navbar-text-content">Rent</p>
                <p className="navbar-text-content">Sell</p>
                <p className="navbar-text-content">Buy</p>
            </div>
            <div className="navbar-cta">
                <Button  size="small" variant="outlined" style={{marginRight:"1rem"}} className="login">Login</Button>
                <Button  size="small" variant="contained" className="signup">Sign up</Button>
            </div>
        </div>
    )
}

export default Navbar
